import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link as RouterLink } from 'react-router-dom';
import { ChakraProvider, extendTheme, Box, Flex, Text, VStack, Input, Spacer, Menu, MenuButton, MenuList, MenuItem, IconButton } from '@chakra-ui/react';
import { Provider } from 'react-redux';
import { store } from './store';

// Layout Components
const Sidebar = () => {
  return (
    <Box bg="blue.500" color="white" w="200px" h="100vh" py={4}>
      <Text fontSize="xl" fontWeight="bold" px={4} mb={6}>Workout App</Text>
      <VStack align="stretch" spacing={1}>
        <SidebarLink to="/" label="Dashboard" />
        <SidebarLink to="/workouts" label="Workouts" />
        <SidebarLink to="/nutrition" label="Nutrition" />
        <SidebarLink to="/progress" label="Progress" />
        <SidebarLink to="/profile" label="Profile" />
      </VStack>
    </Box>
  );
};

const SidebarLink = ({ to, label }) => {
  return (
    <RouterLink to={to} style={{ textDecoration: 'none' }}>
      <Box py={2} px={4} _hover={{ bg: 'blue.600' }} w="100%">
        {label}
      </Box>
    </RouterLink>
  );
};

const Header = () => {
  return (
    <Flex px={4} py={3} bg="white" alignItems="center" borderBottomWidth="1px" borderColor="gray.200">
      <Input placeholder="Search Bar" maxW="400px" />
      <Spacer />
      <Menu>
        <MenuButton as={Box} cursor="pointer">
          User Menu
        </MenuButton>
        <MenuList>
          <MenuItem>Profile</MenuItem>
          <MenuItem>Settings</MenuItem>
          <MenuItem>Logout</MenuItem>
        </MenuList>
      </Menu>
    </Flex>
  );
};

const MainLayout = ({ children }) => {
  return (
    <Flex h="100vh">
      <Sidebar />
      <Box flex="1" overflowY="auto">
        <Header />
        <Box p={4}>
          {children}
        </Box>
      </Box>
    </Flex>
  );
};

// Page Components
const Dashboard = () => <Box>Dashboard Content</Box>;
const Workouts = () => <Box>Workouts Content</Box>;
const Nutrition = () => <Box>Nutrition Content</Box>;
const Progress = () => <Box>Progress Content</Box>;
const Profile = () => <Box>Profile Content</Box>;
const LoginPage = () => <Box p={8}>Login Page</Box>;
const RegisterPage = () => <Box p={8}>Register Page</Box>;
const HomePage = () => (
  <MainLayout>
    <Dashboard />
  </MainLayout>
);

// Custom theme
const colors = {
  brand: {
    50: '#e6f7ff',
    100: '#b3e5fc',
    200: '#81d4fa',
    300: '#4fc3f7',
    400: '#29b6f6',
    500: '#03a9f4',
    600: '#039be5',
    700: '#0288d1',
    800: '#0277bd',
    900: '#01579b',
  },
  accent: {
    50: '#fff8e1',
    100: '#ffecb3',
    200: '#ffe082',
    300: '#ffd54f',
    400: '#ffca28',
    500: '#ffc107',
    600: '#ffb300',
    700: '#ffa000',
    800: '#ff8f00',
    900: '#ff6f00',
  },
};

const theme = extendTheme({
  colors,
  fonts: {
    heading: '"Inter", -apple-system, BlinkMacSystemFont, "Segoe UI", Helvetica, Arial, sans-serif',
    body: '"Inter", -apple-system, BlinkMacSystemFont, "Segoe UI", Helvetica, Arial, sans-serif',
  },
  styles: {
    global: {
      body: {
        bg: 'gray.50',
        color: 'gray.800',
      },
    },
  },
  components: {
    Button: {
      baseStyle: {
        fontWeight: 'bold',
        borderRadius: 'md',
      },
      variants: {
        solid: {
          bg: 'brand.500',
          color: 'white',
          _hover: {
            bg: 'brand.600',
          },
        },
        outline: {
          borderColor: 'brand.500',
          color: 'brand.500',
        },
      },
    },
  },
});

// Main App
function App() {
  return (
    <Provider store={store}>
      <ChakraProvider theme={theme}>
        <Router>
          <Routes>
            <Route path="/login" element={<LoginPage />} />
            <Route path="/register" element={<RegisterPage />} />

            {/* Main App Routes */}
            <Route path="/" element={<HomePage />} />
            <Route path="/workouts" element={
              <MainLayout>
                <Workouts />
              </MainLayout>
            } />
            <Route path="/nutrition" element={
              <MainLayout>
                <Nutrition />
              </MainLayout>
            } />
            <Route path="/progress" element={
              <MainLayout>
                <Progress />
              </MainLayout>
            } />
            <Route path="/profile" element={
              <MainLayout>
                <Profile />
              </MainLayout>
            } />
          </Routes>
        </Router>
      </ChakraProvider>
    </Provider>
  );
}

export default App;
